import React from "react";
import skills from "./Data/skills.json";

const Skills = () => {
  return (
    <>
      <h1>SKILLS</h1>
      <div className="container skills">
        <div className="items">
          {skills.map((data) => (
            <>
              <div className="item" key={data.id}>
                <img src={`/images/${data.imageSrc}`} alt="hello" />
                <h3>{data.title}</h3>
              </div>
            </>
          ))}
        </div>
      </div>
    </>
  );
};

export default Skills;
